import React from 'react'
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import Bangalore from '../components/Bangalore';
import PropertyRateinMumbai from '../components/PropertyRateinMumbai';

const PriceTrendinMumbai = () => {
  return (
    <>
    <Navbar/>
    <Bangalore/>
    <PropertyRateinMumbai/>
    <Footer/>
    </>
  )
}

export default PriceTrendinMumbai
